import React from 'react';
import Overlay from './components/GameOverlay';
import Login from './components/Login';
import './css/App.css';
// import ApiGET from './hooks/ApiGET';
// import ApiPOST from './hooks/ApiPOST';



function App() {
  let inGame = false;

  return (
    <section className="App">
      if (inGame) {
        <Login />
      }
      else {
        <Overlay />
      }

    </section>
  );
}

export default App;
